import { Routes, Route, Outlet } from 'react-router-dom';

import './App.css';
import Home from './routes/home/Home';

const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I am the navigation bar</h1>
      </div>
      <Outlet />
    </div>
  );
};

const Hello = () => {
  return (
    <div>
      <div>
        <h1>Hello there</h1>
      </div>
    </div>
  );
};

const App = () => {
  return (
    <Routes>
      <Route path='/' element={<Navigation />}>
        <Route path='home' element={<Home />} />
        <Route path='hi' element={<Hello />} />
      </Route>
    </Routes>
  );
};

export default App;
